import React from 'react'

import { displayIcon } from '../../util/RegisterStepUtils';
import './RegisterationStepCounter.css'

interface RegisterStepsProps{
    step:number;
}

export const RegistrationStepCounter:React.FC<RegisterStepsProps> = ({step}) => {
  return (
    <div className='reg-step-counter-container'>
        <div className="reg-step-counter-btn">
            {displayIcon(step) }
        </div>
        <span className="reg-stepnumber">Step {step} of 6</span>
    </div>
  )
}
